import Axios from "axios";

const apiURL = 'http://localhost:3000';

export const postrun = async (user_id: any,start_time:any,stop_time:any,duration: any,distance: any,) => {

    let routeURL = '/activities/post';

    let newPostRun= {
        username : user_id,
        start_time : start_time,
        stop_time : stop_time,
        duration : duration,
        distance: distance
    }

    try {
        // Axios.post(apiURL + routeURL, newEmployee);
        console.log(newPostRun.username,',',newPostRun.distance);
        let result = await Axios.post(apiURL + routeURL, newPostRun);

        console.log(result);
        return result;
    } catch (error) {
        alert('Opp...' + error);
    }

}
